INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES (17, 603000503, "バトル開始時、すべてのキャラのＴＰ上昇の上限値を150にする。", "ＴＰ上昇上限付与", 76030005);
INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("boss_def_lower_limit", 603000504, "バトル開始時、すべてのモンスターの物理防御力を中アップさせる。この効果は物理防御力ダウンの影響を受けない。", "物理防御力（ダウン不可）アップ", 76030005);
INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("boss_magic_def_lower_limit", 603000505, "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", "魔法防御力（ダウン不可）アップ", 76030005);
INSERT INTO `v1_54891f294824e1c412d19d0664fafe3448004fd9a8b00a001612aaf3f38335b7` VALUES ("boss_tp_down_cut", 603000506, "バトル開始時、すべてのモンスターがＴＰダウン\n100％カット状態になる。", "ＴＰダウンカット", 76030005);
